import React from 'react'
import styled from 'styled-components'


const Container = styled.div`
    width: 100vw;
    height: 100vh;
    background-color: red;
    display:flex;
    align-items:center;
`
const VideoPlayer = styled.div`
    width: 80vw;
    height: 80vh;
    background-color:black;
`







const Main = () => {
    return (
        <div>
            <Container>
                <VideoPlayer></VideoPlayer>
            </Container>
        </div>
    )
}

export default Main
